import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import CustomerService from '../services/CustomerServices';

const AddCustomerComponent = () => {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [phone_no, setPhoneNo] = useState('');
    const [location, setLocation] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const saveCustomer = (e) => {
        e.preventDefault();

        const customer = { name, email, phone_no, location, password };
        
        CustomerService.createCustomer(customer).then((response) => {
            console.log(response.data);
            navigate('/customers');
        }).catch(error => {
            console.log(error);
        });
    };

    return (
        <div>
            <h1> Add Customer Components Called</h1>
            <br /><br />
           <div className="container">
                <div className="row">
                    <div className="card col-md-6 offset-md-3 offset-md-3">
                        <h2 className='text-center'> Add Customer</h2>
                        <div className="card-body">
                            <form>
                                <div className="form-group mb-2">
                                    <label className="form-label"> Name :</label>
                                    <input
                                        type="text"
                                        placeholder="Enter name"
                                        name="name"
                                        className="form-control"
                                        value={name}
                                        onChange={(e) => setName(e.target.value)}
                                    />
                                </div>

                                <div className="form-group mb-2">
                                    <label className="form-label"> Email :</label>
                                    <input
                                        type="email"
                                        placeholder="Enter email"
                                        name="email"
                                        className="form-control"
                                        value={email}
                                        onChange={(e) => setEmail(e.target.value)}
                                    />
                                </div>

                                <div className="form-group mb-2">
                                    <label className="form-label"> Phone No :</label>
                                    <input
                                        type="text"
                                        placeholder="Enter phone number"
                                        name="phone_no"
                                        className="form-control"
                                        value={phone_no}
                                        onChange={(e) => setPhoneNo(e.target.value)}
                                    />
                                </div>

                                <div className="form-group mb-2">
                                    <label className="form-label"> Location :</label>
                                    <input
                                        type="text"
                                        placeholder="Enter location"
                                        name="location"
                                        className="form-control"
                                        value={location}
                                        onChange={(e) => setLocation(e.target.value)}
                                    />
                                </div>

                                <div className="form-group mb-2">
                                    <label className="form-label"> Password :</label>
                                    <input
                                        type="password"
                                        placeholder="Enter password"
                                        name="password"
                                        className="form-control"
                                        value={password}
                                        onChange={(e) => setPassword(e.target.value)}
                                    />
                                </div>

                                <button className="btn btn-success" onClick={saveCustomer}>Submit</button>
                                <Link to="/customers" className="btn btn-danger" style={{ marginLeft: "10px" }}>Cancel</Link>
                            </form>
                        </div>
                    </div>
                </div>
           </div> 
        </div>
    );
};

export default AddCustomerComponent;
